module m_stamp

  !! Declarations
  use m_std
  use m_system
  use m_pnm
  implicit none
  private

  !! Public
  public :: stamp__char

  !! --

  interface stamp__char
     module procedure char_mono, char_col
  end interface stamp__char

  !! ----

contains


  !! --------------------------------------------------------------------------------------------------------------------------- !!
  !>
  !! モノクロ画像データのi0, j0を左上とする位置に、文字コード 32-127 に相当する文字列を描画する。
  !! 一文字あたり縦20, 横12のサイズが画像imgに確保されていなければならない。
  !! フォントデータは幅15で作成されているが、描画は12まで詰める。 is_white = .true. が指定されると反転白抜きにする。
  !<
  !! --
  subroutine char_mono( char, i0, j0, wid, hei, img, is_white)

    !! -- Arguments
    character(*), intent(in) :: char
    integer, intent(in) :: i0, j0 ! reference location
    integer, intent(in) :: wid, hei ! image size
    integer, intent(inout) :: img(wid,hei)
    logical, intent(in), optional :: is_white

    !! -- Parameters
    integer, parameter :: W0 = 15
    integer, parameter :: H0 = 20
    integer, parameter :: W1 = 10
    !!
    logical, save :: is_first = .true.
    integer, save :: cimg(W0,H0,32:127)
    integer :: i, is, js, ie, je, ic
    logical :: is_really_white
    !! ----

    if( is_first ) then
       is_first = .false.
       call char_img( cimg )
    end if

    is_really_white = .false.
    if( present( is_white ) ) then
       if( is_white ) then
          is_really_white = .true.
       end if
    end if

    if( j0 + H0 > hei .or. i0 + len_trim(char) * W1 > wid ) then
       write(STDERR,*) "size exceeds"
    end if

    do i=1, len_trim(char)
       ic = ichar( char(i:i) )
       if( ic < 32 .or. ic > 126 ) then
          write(STDERR,*) "character out of range"
          exit
       end if

       ! 幅15データのうち10を使う「詰め」モード
       is = i0 + (i-1)*W1
       js = j0
       ie = is + W1 - 1
       je = js + H0 - 1

       if( ie <= wid .and. je <= hei ) then
          if( is_really_white ) then
             img( is:ie, js:je )  = 255 &
                  - int( ( 255 - img(is:ie,js:je) ) * cimg(3:12,1:H0,ic) / 255. )
          else
             img( is:ie, js:je )  = &
                  int( img(is:ie,js:je) * cimg(3:12,1:H0,ic) / 255. )
          end if
       end if

    end do


  end subroutine char_mono
  !! --------------------------------------------------------------------------------------------------------------------------- !!


  !! --------------------------------------------------------------------------------------------------------------------------- !!
  !>
  !! カラー画像データのi0, j0を左上とする位置に、文字コード 32-127 に相当する文字列を描画する。
  !! char_monoを複数回callすることで実現する。
  !<
  !! --
  subroutine char_col( char, i0, j0, wid, hei, img, is_white)

    !! -- Arguments
    character(*), intent(in) :: char
    integer, intent(in) :: i0, j0 ! reference location
    integer, intent(in) :: wid, hei ! image size
    integer, intent(inout) :: img(3,wid,hei)
    logical, intent(in), optional :: is_white
    !!
    integer, parameter :: W0 = 15
    integer, parameter :: H0 = 20
    !! ----

    if( present( is_white ) ) then
       call char_mono( char, i0, j0, wid, hei, img(1,:,:), is_white )
       call char_mono( char, i0, j0, wid, hei, img(2,:,:), is_white )
       call char_mono( char, i0, j0, wid, hei, img(3,:,:), is_white )
    else
       call char_mono( char, i0, j0, wid, hei, img(1,:,:) )
       call char_mono( char, i0, j0, wid, hei, img(2,:,:) )
       call char_mono( char, i0, j0, wid, hei, img(3,:,:) )
    end if

  end subroutine char_col
